import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  salary: number = 0;
  renta: number = 0;
  afp: number = 0;
  isss: number = 0;
  netSalary: number = 0;
  showResults: boolean = false;

  calculate() {
    this.calculateRenta();
    this.calculateAFP();
    this.calculateISSS();
    this.netSalary = this.salary - this.renta - this.afp - this.isss;
    this.showResults = true;
  }

  calculateRenta() {

    if (this.salary > 0.01 && this.salary <= 472.00) {
      // Tramo 1: No se aplica nada
      this.renta = 0;
    } else if (this.salary > 0.01 && this.salary <= 472.00) {
      // Tramo 2: 10% sobre el exceso de $0.01, más cuota fija de $0
      const exceso = this.salary - 0.01;
      this.renta = exceso * 0.10;
    } else if (this.salary <= 895.24) {
      // Tramo 3: 10% sobre el exceso de $472.00, más cuota fija de $17.67
      const exceso = this.salary - 472.00;
      this.renta = exceso * 0.10 + 17.67;
    } else if (this.salary <= 2038.10) {
      // Tramo 4: 20% sobre el exceso de $895.24, más cuota fija de $60.00
      const exceso = this.salary - 895.24;
      this.renta = exceso * 0.20 + 60.00;
    } else {
      // Tramo 5: 30% sobre el exceso de $2038.10, más cuota fija de $288.57
      const exceso = this.salary - 2038.10;
      this.renta = exceso * 0.30 + 288.57;
    }
    
  }

  calculateAFP() {
    const AFP_PERCENTAGE = 0.0725;  
    this.afp = this.salary * AFP_PERCENTAGE;
  }

  calculateISSS() {
    const ISSS_PERCENTAGE = 0.03;  
    this.isss = this.salary * ISSS_PERCENTAGE;
  }
}
